import React from "react";
import { Button,
          FormGroup,
          FormControl,
        } from "react-bootstrap";

import {
  Container,
  Row,
  Col,
} from "react-bootstrap";

function LogIn() {
  return (
    <>
      <Container fluid>
        <Col>
          <FormGroup controlId = "username" size = "lg">
            <FormControl>
              Enter Username
            </FormControl>
          </FormGroup>

          <FormGroup controlId = "password" size = "lg">
            <FormControl>
              EnterPassword
            </FormControl>
          </FormGroup>
        </Col>
      </Container>
    </>
  );
}
export default LogIn;
